/*!50003 CREATE*/ /*!50017 DEFINER=`ontargetp`@`%`*/ /*!50003 TRIGGER `onsite_file_uploaded` AFTER INSERT ON `project_file` FOR EACH ROW
BEGIN
	
	DECLARE userNotificationId BIGINT;
	DECLARE insertId INT;
	declare projectMember bigint;
    declare done int default false;    
    declare projectFileCreator varchar(30);
    declare verbiage text;
    declare projectMemberCursor cursor for select user_id from project_member where member_status='ACTIVE' AND  project_id=NEW.project_id;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

	set projectFileCreator=get_userNameById(NEW.created_by);
	
	set verbiage=CONCAT(projectFileCreator, " has uploaded ", SUBSTRING_INDEX(NEW.file_name,'/',-1));
		
	
		INSERT INTO activity_log (TEXT, user_id,category,ts_insert,project_id) VALUES
		(verbiage,NEW.created_by,5, NOW(),NEW.project_id);
            
    -- send it to the assigner as well
    
    		INSERT INTO user_notification (TEXT, STATUS,user_id, ts_insert,notification_type, project_id)
			VALUES (verbiage,"NEW",NEW.created_by, NOW(),"PROJECT_FILE", NEW.project_id);
		 
			SET userNotificationId = LAST_INSERT_ID();
			
			
			INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
			VALUES('notificationType','projectFileId',userNotificationId);
							
			INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
			VALUES('notificationId',NEW.project_file_id,userNotificationId);
			
			INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
			VALUES('notificationType','projectId',userNotificationId);
							
			INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
			VALUES('notificationId',NEW.project_id,userNotificationId);
    
    
    -- multiple users assigned. so when update send notification to all users assigned to.
    
	open projectMemberCursor;
    
    cursor_loop:repeat
	fetch projectMemberCursor into projectMember;
		if done then
			leave cursor_loop;
		end if;
	
		if NEW.created_by != projectMember then 
	
			INSERT INTO user_notification (TEXT, STATUS,user_id, ts_insert,notification_type, project_id)
			VALUES (verbiage,"NEW",projectMember, NOW(),"PROJECT_FILE", NEW.project_id);
		 
			SET userNotificationId = LAST_INSERT_ID();
					
			INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
			VALUES('notificationType','projectFileId',userNotificationId);
							
			INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
			VALUES('notificationId',NEW.project_file_id,userNotificationId);
	
			
			INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
			VALUES('notificationType','projectId',userNotificationId);
							
			INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
			VALUES('notificationId',NEW.project_id,userNotificationId);
			
		end if;
	
    until done
    
    end repeat;
    
    close projectMemberCursor;

END */;;
DELIMITER ;
