/*!50003 CREATE*/ /*!50017 DEFINER=`ontargetp`@`%`*/ /*!50003 TRIGGER `task_assignee_AFTER_INSERT` AFTER INSERT ON `task_assignee` FOR EACH ROW 
begin

	DECLARE userNotificationId BIGINT;
    declare projectId bigint;
    DECLARE assignerName varchar(30);
    DECLARE verbiage text;
    
    set projectId = (select project_id from project_task where project_task_id=NEW.project_task_id);
    
    set assignerName=get_userNameById(NEW.created_by);
    
    set verbiage=CONCAT(assignerName," has assigned ", getProjectTaskTitleById(NEW.project_task_id), " to ", get_userNameById(NEW.task_assignee));

	INSERT INTO activity_log (TEXT, user_id,category,ts_insert,project_id) VALUES (verbiage,NEW.created_by,4, NOW(),projectId);
    
    INSERT INTO user_notification (TEXT, STATUS,user_id, ts_insert,notification_type,project_id)
	VALUES (verbiage,"NEW",NEW.created_by, NOW(),"TASK_ASSIGNEE", projectId);
 
	SET userNotificationId = LAST_INSERT_ID();
	
	INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
	VALUES('notificationType','taskId',userNotificationId);
	
	INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
	VALUES('notificationId',NEW.project_task_id,userNotificationId);
	
	INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
	VALUES('notificationType','activityId',userNotificationId);
	
	INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
	VALUES('notificationId',projectId,userNotificationId);
	
	INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
	VALUES('notificationType','projectId',userNotificationId);
					
	INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
	VALUES('notificationId',getProjectParentIdById(projectId),userNotificationId);

end */;;
