/*!50003 CREATE*/ /*!50017 DEFINER=`ontargetp`@`%`*/ /*!50003 TRIGGER `log_comment_add` AFTER INSERT ON `task_comment` FOR EACH ROW
BEGIN
 
	DECLARE userNotificationId BIGINT;
	declare activityId BIGINT;
	declare taskAssignedTo bigint;
    declare done int default false;
    declare commentedByName varchar(30);
    declare taskCreator int(10);
    declare verbiage text;
    declare projectId int(10);
	declare taskAssigneeCursor cursor for select task_assignee from task_assignee where project_task_id=NEW.task_id;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;


	set commentedByName=get_userNameById(NEW.commented_by);	
	set verbiage=CONCAT(commentedByName, " has commented on ", getProjectTaskTitleById(NEW.task_id));
	
	set taskCreator=(select created_by from project_task where project_task_id=NEW.task_id);
	set projectId=getProjectParentIdById(getActivityIdByTaskId(NEW.task_id));
	
	INSERT INTO activity_log (TEXT, user_id,category,ts_insert,project_id) VALUES
	(verbiage,NEW.commented_by,1, NOW(),projectId);
	
	 -- send it to the assigner as well
    
    		INSERT INTO user_notification (TEXT, STATUS,user_id, ts_insert,notification_type, project_id)
			VALUES (verbiage,"NEW",taskCreator, NOW(),"TASK_COMMENTS", projectId);
		 
			SET userNotificationId = LAST_INSERT_ID();
			
			INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
			VALUES('notificationType','taskId',userNotificationId);
			
			INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
			VALUES('notificationId',NEW.task_id,userNotificationId);
			
			INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
			VALUES('notificationType','activityId',userNotificationId);
			
			INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
			VALUES('notificationId',getActivityIdByTaskId(NEW.task_id),userNotificationId);
			
			INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
			VALUES('notificationType','projectId',userNotificationId);
							
			INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
			VALUES('notificationId',projectId,userNotificationId);
	
	
	
	
	-- multiple users assigned. so when update send notification to all users assigned to.
    
	open taskAssigneeCursor;
    
    cursor_loop:repeat
	fetch taskAssigneeCursor into taskAssignedTo;
		if done then
			leave cursor_loop;
		end if;
	
		IF taskCreator != taskAssignedTo THEN
	
			INSERT INTO user_notification (TEXT, STATUS,user_id, ts_insert,notification_type, project_id)
			VALUES (verbiage,"NEW",taskAssignedTo, NOW(),"TASK_COMMENTS", projectId);
		 
			SET userNotificationId = LAST_INSERT_ID();
			
			INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
			VALUES('notificationType','taskId',userNotificationId);
			
			INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
			VALUES('notificationId',NEW.task_id,userNotificationId);
			
			INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
			VALUES('notificationType','activityId',userNotificationId);
			
			INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
			VALUES('notificationId',getActivityIdByTaskId(NEW.task_id),userNotificationId);
			
			INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
			VALUES('notificationType','projectId',userNotificationId);
							
			INSERT INTO user_notification_attribute(attribute_key,attribute_value,user_notification_id)
			VALUES('notificationId',projectId,userNotificationId);
		END IF;
	
    until done
    
    end repeat;
    
    close taskAssigneeCursor;
          
END */;;
